import React from "react";
import { FaTrash } from "react-icons/fa"; 

function TodoItem(props){
    
    return (
        <div>
            <li>
                <input type="checkbox" onChange={() => props.onChecked(props.id)} />
                {props.todoItem}
                <button onClick={() => props.onDelete(props.id)}>
                    <FaTrash /> {/* Delete icon */}
        </button>
            </li>
        </div>
    )
}

export default TodoItem;
